import React from 'react';
import VideoItem from './VideoItem';

const VideoList = ({ videos, onDelete }) => (
  <div className="video-list">
    {videos.map((video) => (
      <VideoItem
        key={video.id}
        video={video}
        onDelete={onDelete} />
    ))}
  </div>
);

export default VideoList;
